import React from 'react';
import ExpenseCard from './ExpenseCard';
import {
    Box,
    Button,
    Card,
    CardHeader,
    Table,
    TableBody,
    TableCell,
    TableHead,
    TableRow,
    TableSortLabel,
    Tooltip
  } from '@mui/material';

function ExpenseCardList({expenses}){

    console.debug("expenses","expenses=",expenses);

    return (
        <div>
            {expenses.map(expense =>(
                <ExpenseCard 
                    key ={expense.id}
                    id={expense.id}
                    amount={expense.amount}
                    category={expense.category}
                    detail={expense.detail}
                    date={expense.date}
                    />
            ))}
<Card >
    <CardHeader title="Latest Orders" />
    {/* <PerfectScrollbar> */}
      <Box sx={{ minWidth: 800 }}>
        <Table>
          <TableHead>
            <TableRow>
              <TableCell>
                Order Ref
              </TableCell>
              <TableCell>
                Customer
              </TableCell>
              <TableCell sortDirection="desc">
                <Tooltip
                  enterDelay={300}
                  title="Sort"
                >
                  <TableSortLabel
                    active
                    direction="desc"
                  >
                    Date
                  </TableSortLabel>
                </Tooltip>
              </TableCell>
              <TableCell>
                Status
              </TableCell>
            </TableRow>
          </TableHead>
          <TableBody>
            {orders.map((order) => (
              <TableRow
                hover
                key={order.id}
              >
                <TableCell>
                  {order.ref}
                </TableCell>
                <TableCell>
                  {order.customer.name}
                </TableCell>
                <TableCell>
                {order.customer.name}
                  {/* {format(order.createdAt, 'dd/MM/yyyy')} */}
                </TableCell>
                <TableCell>
                {order.ref}

                </TableCell>
              </TableRow>
            ))}
          </TableBody>
        </Table>
      </Box>
  </Card>
        </div>
    )

}

export default ExpenseCardList;
